import Svg, { G, Path } from 'react-native-svg';
/* SVGR has dropped some elements not supported by react-native-svg: style */

export const IconInsightsSolid = props => (
  <Svg
    width={22}
    height={22}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    {...props}
  >
    <G id="Insights">
      <Path
        d="M.9 6.3h4.7v14.5H.9zM8.5.9h4.7v20H8.5zM16.1 10.6h4.7v10.3h-4.7z"
        fill={Colors.HERO_BLUE}
      />
    </G>
  </Svg>
);
